// src/data/tiles.js

export const tiles = [
  {
    id: 0,
    name: 'Start',
    type: 'event',
    position: { x: 20, y: 520 },
    nextBelow7: 1,
    nextAbove7: 1
  },
  {
    id: 1,
    name: 'Samsung',
    type: 'property',
    position: { x: 72, y: 431 },
    nextBelow7: 3,
    nextAbove7: 4,
    cost: 100,
    rent: 10
  },
  
  
];
